import React, { useState } from 'react';

function Main() {
  const [text, setText] = useState('Hello');

  const changeText = () => {
    setText('Bye');
  };

  return (
    <div>
      <h1>{text}</h1>
      <button onClick={changeText}>Change Text</button>
    </div>
  );
}

export default Main;
